import React, {useState} from 'react'
import {Link, Route, BrowserRouter as Router, Switch} from 'react-router-dom'
import Spinner from 'react-bootstrap/Spinner'
import Button from 'react-bootstrap/Button'
import Data from './Data'
import Modal from "react-bootstrap/ModalHeader"


const User = ({loader,data}) =>{

    const [modalShow, setModalShow] = useState(false);
    // const newUser = () =>{
    //     console.log('clicked')
    // }

    
    // Add new User
    return (
        <>
         <nav><h1>User</h1>
         <ul><li>About</li><li>Contact</li></ul>
         <Button  variant="primary" onClick={() => setModalShow(true)}>Add a user</Button>
         {modalShow?  <Modal
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header closeButton>
        <Modal.Title id="contained-modal-title-vcenter">
          Modal heading
        </Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <h4>Centered Modal</h4>
        <p>
          Cras mattis consectetur purus sit amet fermentum. Cras justo odio,
          dapibus ac facilisis in, egestas eget quam. Morbi leo risus, porta ac
          consectetur ac, vestibulum at eros.
        </p>
      </Modal.Body>
      <Modal.Footer>
        <Button onClick={() => setModalShow(false)}>Close</Button>
      </Modal.Footer>
    </Modal> : null}
        
         </nav>
         {!loader ? <Spinner animation="grow" /> : <div className = "user-table"><h1>Homepage</h1><Data data = {data}/> </div>  } 
      
        </>
    )
}

export default User;
